import React from 'react';
import { toFixedToTwo, toUnit } from '../../helper/formatter';
export default () => {
  const excludeStoreColdef = [
    {
      Header: 'Store ID',
      accessor: 'store_code',
      width: 50,
    },
    // {
    //   Header: "Store Description",
    //   accessor: "store_desc"
    // },
    {
      Header: 'Sell Through %',
      columns: [
        {
          Header: 'LY',
          accessor: 'sell_through.ly',
          Cell: (props) => <div> {toFixedToTwo(props)} </div>,
        },
        {
          Header: 'TY',
          accessor: 'sell_through.ty',
          Cell: (props) => <div> {toFixedToTwo(props)} </div>,
        },
      ],
    },
    {
      Header: 'Margin %',
      columns: [
        {
          Header: 'LY',
          accessor: 'margin.ly',
          Cell: (props) => <div> {toFixedToTwo(props)} </div>,
        },
        {
          Header: 'TY',
          accessor: 'margin.ty',
          Cell: (props) => <div> {toFixedToTwo(props)} </div>,
        },
      ],
    },
    {
      Header: 'Inventory On Hand',
      accessor: 'inventory',
    },
    {
      Header: 'Actual Sales',
      Cell: (props) => <div> {toUnit(props)} </div>,
      accessor: 'actual_sales',
    },
    {
      Header: 'Model Predicted Sales',
      accessor: 'predicted_sales',
    },

    {
      Header: 'Sales Contribution %',
      Cell: (props) => <div> {toFixedToTwo(props)} </div>,
      accessor: 'sales_contrib',
    },
  ];
  return excludeStoreColdef;
};
